  "insertBox2": "\n                                    <!-- 회사ID -->\n                                    <div  class=\"form-group col-md-6 p-2  \">\n                                        <label for=\"items_companyId\"><span class=\"notnull\">*</span>회사ID</label>\n                                        <input type=\"text\" id=\"items_companyId\" class=\"form-control\" v-model=\"items.companyId\" placeholder=\"회사ID\"  />\n                                    </div>\n \n                                    <!-- 부서 이름 -->\n                                    <div  class=\"form-group col-md-6 p-2  \">\n                                        <label for=\"items_partName\">부서 이름</label>\n                                        <input type=\"text\" id=\"items_partName\" class=\"form-control\" v-model=\"items.partName\" placeholder=\"부서 이름\"  />\n                                    </div>\n \n                                    <!-- 사용여부 -->\n                                    <div  class=\"form-group col-md-6 p-2 \">\n                                        <label for=\"items_useAt\">사용여부</label>\n                                        <select class=\"custom-select\" id=\"items_useAt\"  v-model=\"items.useAt\">\n                                            <option selected value=\"\" >사용여부</option>\n                                        </select>\n                                    </div>",
